import React from "react";
import LogIn from "./LogIn";
import image from "./Images/DogCat.jpeg";
import Logo from "./Images/PetFriendlyLogo.jpg";

function Home() {
  return (
    <div className=" pageCard row justify-content-center">
      <div className="pb-2 col-12 col-md-6 order-md-2">
        <div className="">
          <img className="logoHeight" src={Logo} alt="" height=""></img>
        </div>
        <div className="formHeight align-self-center bg-dark">
          <LogIn></LogIn>
        </div>
      </div>

      <div className="dogImgHeight pb-2 col-12 col-md-6 order-md-1">
        <img src={image} alt=""></img>
      </div>
    </div>
  );
}

export default Home;
